import React from "react";
import Link from "@material-ui/core/Link";
import Typography from "@material-ui/core/Typography";

export default function Footer() {
  return (
    <Typography
      className="footer"
      variant="body2"
      color="textSecondary"
      align="center"
    >
      {"Copyright © "}
      <Link color="inherit" href="/">
        Travel Like A Local
      </Link>{" "}
      {new Date().getFullYear()}
      {"."}
    </Typography>
  );
}
